import React from "react";
import "./App.css";
import Header from "../Header/Header";
import Footer from "../Footer/Footer";

import "bootstrap/dist/css/bootstrap.css";

function App() {
  return (
    <div className="App">
      <Header />

      <Footer />
    </div>
  );
}

export default App;
